export const SelectorActionTypes = {
  CREATE: "CREATE",
  CREATE_SUCCESS: "CREATE_SUCCESS",
  CREATE_ERROR: "CREATE_ERROR",

  DELETE: "DELETE",
  DELETE_SUCCESS: "DELETE_SUCCESS",
  DELETE_ERROR: "DELETE_ERROR",
};

Object.keys(SelectorActionTypes).forEach((key) => {
  SelectorActionTypes[
    key
  ] = `SELECTOR_${SelectorActionTypes[key]}`;
});

const onCreate = (params) => ({
  type: SelectorActionTypes.CREATE,
  payload: params,
});

const onCreateSuccess = (detail) => ({
  type: SelectorActionTypes.CREATE_SUCCESS,
  payload: detail,
});

const onCreateError = (error) => ({
  type: SelectorActionTypes.CREATE_ERROR,
  payload: error,
});

/**
 *
 * delete
 */
const onDelete = ({ id }) => ({
  type: SelectorActionTypes.DELETE,
  id,
});

const onDeleteSuccess = (detail) => ({
  type: SelectorActionTypes.DELETE_SUCCESS,
  payload: detail,
});

const onDeleteError = (error) => ({
  type: SelectorActionTypes.DELETE_ERROR,
  payload: error,
});


const SelectorActions = {
  onCreate,
  onCreateSuccess,
  onCreateError,

  onDelete,
  onDeleteSuccess,
  onDeleteError,
};

export default SelectorActions;
